import First from "./first";
import "./home.css"
import Navbar from "./navbar";
import Blog from "../Blog/blog";
import Solo from "../Blog/solo";
import Partner from "../partners/partner";
function Full(){
    return(
        <>
        <First></First>
        <Blog></Blog>
        <Solo></Solo>
        <Solo></Solo>
        <Partner></Partner>
        </>
    )
}
export default Full;
